import Tab from '@mui/material/Tab';
import styled from 'styled-components';

const StyledTab = styled(Tab)`
  && {
    text-transform: none !important;
    // background-color: var(--accent);
    color: var(--accent);
    &:active {
      color: var(--accent);
    }
  }
`;

export default StyledTab;
